package com.cmos.websocket.constant;

import java.io.File;
import java.io.IOException;
import java.nio.charset.StandardCharsets;
import java.util.Base64;

import org.apache.commons.io.FileUtils;

/**
 * 将base64字符串变成图片
 * 
 * @author chenhao
 *
 */
public class Base64Img {

    public static void main(String[] args) {
        // 图片消息前缀：data:image/png;base64,
        String base64Str = "";
        String path = "C:\\Users\\chenhao\\Desktop\\dev";
        String filename = "demo.png";
        File folder = new File(path);
        if (!folder.exists()) {
            folder.mkdirs();
        }
        File dest = new File(folder, filename);
        byte[] bytes = Base64.getDecoder().decode(base64Str.getBytes(StandardCharsets.UTF_8));
        try {
            FileUtils.writeByteArrayToFile(dest, bytes);
        } catch (IOException e) {
            e.printStackTrace();
        }
    }
}
